import React from 'react';

import { Container, Column } from './styles';
import Card from '../Card';

function List({title}) {
  return (
      <>
       <Column>
        <Container>

            <header>
              <h2>{title}</h2>

              <ul>

                 <Card data={'Diogo S'}   pontuation={1}/>
                 <Card data={'Felipe '}  pontuation={1}/>
                 <Card data={'Luana'}  pontuation={1}/>
                 <Card data={'Pamela'}  pontuation={1}/>
                 <Card data={'Victor '}  pontuation={1}/>
                 <Card data={'Eric '}  pontuation={1}/>
                 <Card data={'Juliana'}  pontuation={1}/>
                 <Card data={'Niedson '}  pontuation={1}/>
                 <Card data={'Vinicius '}   pontuation={1}/>
              </ul>
            </header>

        </Container>
        </Column>
      </>
  );
}

export default List;
